import React from "react";
import { BrowserRouter, Router, Routes, Route, Link } from "react-router-dom";
import Login from "./Component/Login";
import Register from "./Component/Register";
import Home from "./Component/Store/Home";
import Shop from "./Component/Store/Shop";
import "./Asset/app.css";

//tailwindcss

import "./index.css";

//css from theme

import "./Asset/css/style.css";
import "./Asset/css/elegant-icons.css";
import "./Asset/css/customs.css";

import Admin from "./Component/Admin/Admin";
import Product from "./Component/Admin/Admin-Products/Product";
import Sidebar from "./Component/Admin/Sidebar/Sidebar";
/*

*/
function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/">
          <Route index element={<Home />} />
          <Route path="/shop" element={<Shop />} />
        </Route>
      </Routes>
      <div className="flex">
        <Routes>
          <Route path="/admin" element={<Sidebar />}></Route>
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
